import logo from './logo.svg';
import pic1 from './pic1.jpeg';
import './App.css';
import $ from 'jquery';


function App() {
  return (
  <>
    <div className="App">

    </div>


    <div className = 'picture'>
      <img id ='picture1' src={pic1} alt="picture1" />
    </div>
  </>
  );
}

$(document).ready(function() {
  $(window).scroll(function() {

    var scrollTop = $(window).scrollTop();

    if (scrollTop < 690) {
      $('#picture1').css({
        'position': 'relative',
        'margin-top': '690px'
      });
    }

    if (scrollTop < 2 * 690) {
      $('#three').css({
        'position': 'relative',
        'margin-top': 2 * 690 + 'px'
      });
    }

    if (scrollTop >= 690) {
      $('#two').css({
        'margin-top': 0,
        'position': 'fixed'
      });
    }

    if (scrollY >= 2 * 690) {
      $('#three').css({
        'margin-top': 0,
        'position': 'fixed'
      });
      $('#four').css({
        'margin-top': 3 * 690 + 'px'
      });
    }

  });
});


export default App;
